import React, { Component } from 'react'
import '../styles/Header.scss'
import Dropdown from 'react-simple-dropdown';


class Header extends Component {

    Trigger = Dropdown.DropdownTrigger;
    Content = Dropdown.DropdownContent;

    render(){
        return(
            <div id ='headerDiv'>
                <span id = 'headerName'>Matthew Abrey</span>
                <Dropdown>
                    <Trigger>{String.fromCharCode(9776)}</Trigger>
                    <Content>
                        <ul>
                            <li>
                                <a href= "#aboutHeader" >About</a>
                            </li>
                        </ul>
                    </Content>
                </Dropdown>
                {/* <button id = 'hamburgerMenu'>{String.fromCharCode(9776)}</button> */}
            </div>
        );
    }
}
export default Header
